import React from 'react'

export const FooterLinks = (props) => {
  return (
    <div class="footer-col">
      <h4>{props.title}</h4>
      <ul>
        <li><a href="#">{props.content}</a></li>
      </ul>
    </div>
  );
};

export default FooterLinks
